import React from 'react';
import { Brand, Navbar, CTA } from './components';
import { Footer, Blog, Possibility, Features, WhatGPT3, Header} from './containers'
import './App.css';

function App() {
  return (
    <div className="App">
    <div className="gradient__bg">
      <Navbar />
      <Header />

    <Brand />
    <WhatGPT3 />
    <Features />
    <Possibility />
    <CTA />
    <Blog />
    <Footer />
    </div>
  </div>
  );
}

export default App;
